import React, { useState } from 'react'
import Main from './components/Main'
import LogIn from './components/LogIn';
import Albums from './components/Albums';
import Posts from './components/Posts';
import Todos from './components/Todos';
import Info from './components/info';
import Photo from './components/Photo';
import { Routes, Route ,Router} from 'react-router-dom';


function App() {
    const [currentUser, setCurrentUser] = useState();
    const [album, setAlbumId] = useState();
    function hundleCurrent(data) {
        setCurrentUser(data);
    }
    function hundleAlbum(data) {
        setAlbumId(data);
    }
    return (
        <div>
            <Router>
            <Routes>
                <Route path="/" element={<LogIn hundleCurrent={hundleCurrent} />} />
                <Route path="/Main" element={<Main currentUser={currentUser} />} >
                    <Route path="Albums" element={<Albums currentUser={currentUser} hundleAlbum={hundleAlbum} />} />
                    <Route path="Posts" element={<Posts currentUser={currentUser} />} />
                    <Route path="Todos" element={<Todos currentUser={currentUser} />} />
                    <Route path="Info" element={<Info currentUser={currentUser} />} />
                    <Route path="/albums/photo" element={<Photo currentUser={currentUser} album={album} />} />
                </Route>
            </Routes>
            </Router>
        </div>

    );

}
export default App
